import { useContext, useState } from "react";
import { Nav } from "react-bootstrap";
import { ListGroup } from "react-bootstrap";
import { useHistory } from "react-router-dom";
import { SiteContext } from "../../context";
import { Company } from "../../types";

interface CompaniesScreenProps {
    HistoryCompanyList : Company[];

}

const CompaniesScreen = ({} : CompaniesScreenProps) => {
    const history = useHistory();
    const { companies: companies } = useContext(SiteContext);

    return (
        <div>
            <h1>Companies</h1>
            <ListGroup>
                {
                    companies.map((company: Company) => {
                        return <Nav.Link as={ListGroup.Item} action onClick={() => {history.push("/companies/" + company.id)}}>{company.name}</Nav.Link>
                    })
                }
  
            </ListGroup>

            
        </div>
    )
}

export default CompaniesScreen;
